-- ----------------------------
-- Table structure for sp_activity_goods
-- ----------------------------
DROP TABLE IF EXISTS `sp_activity_goods`;
CREATE TABLE `sp_activity_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `goods_name` varchar(50) NOT NULL COMMENT '商品名称',
  `search_keywords` varchar(150) NOT NULL COMMENT '搜索关键词',
  `thumb_url` varchar(100) DEFAULT NULL COMMENT '缩略图',
  `market_price` decimal(10,2) NOT NULL COMMENT '市场价格',
  `shop_price` decimal(10,2) NOT NULL COMMENT '会员价格',
  `min_market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最小市场价格',
  `max_market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最大市场价格',
  `min_price` decimal(10,2) DEFAULT NULL COMMENT '商品最小区间价格',
  `max_price` decimal(10,2) DEFAULT NULL COMMENT '商品最大区间价格',
  `zs_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '展示价格',
  `onsale` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否在售1,0',
  `cate_id` int(10) unsigned NOT NULL COMMENT '分类id',
  `shcate_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商家分类id',
  `brand_id` int(10) unsigned DEFAULT '0' COMMENT '品牌id',
  `type_id` int(10) unsigned DEFAULT '0' COMMENT '类型id',
  `goods_desc` text NOT NULL COMMENT '商品描述',
  `keywords` varchar(255) DEFAULT NULL,
  `goods_brief` varchar(255) DEFAULT NULL,
  `fuwu` varchar(50) DEFAULT NULL COMMENT '服务项id集合',
  `shuxings` varchar(255) DEFAULT NULL COMMENT '属性集合',
  `addtime` int(10) unsigned NOT NULL,
  `onclick` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品浏览量',
  `sale_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已售量',
  `deal_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '成交量',
  `deal_lv` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '成交率',
  `comment_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论数量',
  `praise_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '好评量',
  `praise_lv` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '好评率',
  `coll_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收藏量',
  `shopzh_lv` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商家综合评分率',
  `zonghe_lv` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品综合率',
  `is_free` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0:不包邮 1:包邮',
  `is_recycle` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否放进回收站',
  `is_special` tinyint(1) unsigned DEFAULT '0' COMMENT '是否特价',
  `is_new` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否新品',
  `is_hot` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否热门',
  `is_recommend` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐',
  `is_activity` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0：非活动商品 1：活动商品',
  `checked` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1：正常  2：违规',
  `leixing` tinyint(1) unsigned NOT NULL COMMENT '类型1：自营  2：商家',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商铺id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `cate_id` (`cate_id`) USING BTREE,
  KEY `brand_id` (`brand_id`) USING BTREE,
  KEY `type_id` (`type_id`) USING BTREE,
  KEY `shop_price` (`shop_price`) USING BTREE,
  KEY `onsale` (`onsale`) USING BTREE,
  KEY `is_recycle` (`is_recycle`) USING BTREE,
  KEY `is_special` (`is_special`) USING BTREE,
  KEY `is_new` (`is_new`) USING BTREE,
  KEY `is_hot` (`is_hot`) USING BTREE,
  KEY `is_recommend` (`is_recommend`) USING BTREE,
  KEY `goods_name` (`goods_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of sp_activity_goods
-- ----------------------------

