DROP TABLE IF EXISTS `sp_alive`;
CREATE TABLE `sp_alive` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `shop_id` int(10) DEFAULT NULL COMMENT '地铺地址',
  `status` tinyint(1) DEFAULT '-1' COMMENT '1直播中-1等待直播 2: 直播被管理员关闭',
  `alivetime` int(11) DEFAULT NULL COMMENT '直播时间',
  `room` varchar(10) DEFAULT NULL COMMENT '直播房间号',
  `starttime` int(11) DEFAULT NULL COMMENT '直播开始时间',
  `endtime` int(11) DEFAULT NULL COMMENT '直播结束时间',
  `robot` int(5) DEFAULT '0' COMMENT '机器人数量',
  `cover` varchar(300) DEFAULT NULL COMMENT '封面',
  `title` varchar(266) DEFAULT NULL COMMENT '房间标题',
  `notice` varchar(644) DEFAULT NULL COMMENT '房间公告',
  `isrecommend` tinyint(1) DEFAULT '-1' COMMENT '是否首页推荐1推荐',
  `isnewperson` tinyint(1) DEFAULT '1' COMMENT '是否是新人1新人',
  `cateid` int(10) DEFAULT NULL COMMENT '商品顶级分类id',
  `issincerity` tinyint(1) DEFAULT '-1' COMMENT '是否是诚信商家',
  `isclose` tinyint(1) DEFAULT '0' COMMENT '是否关闭',
  `city_name` varchar(255) NOT NULL COMMENT '城市名称',
  `area_name` varchar(255) NOT NULL COMMENT '地区名称',
  `user_profile` varchar(500) NOT NULL COMMENT '主播介绍',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品类型id',
  `video_link` varchar(500) DEFAULT NULL COMMENT '视频链接',
  `start_time` varchar(10) DEFAULT NULL COMMENT '开始时间',
  `end_time` varchar(10) DEFAULT NULL COMMENT '结束时间',
  `is_pay` int(1) DEFAULT '0' COMMENT '是否付费直播',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '付费金额',
  `alive_sn` varchar(255) DEFAULT NULL COMMENT '付费直播编号',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `uid` (`shop_id`) USING BTREE,
  UNIQUE KEY `room` (`room`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

