  `sfzz_pic` varchar(150) NOT NULL COMMENT '法人或个人身份证正面图片',
  `sfzb_pic` varchar(150) NOT NULL COMMENT '法人或个人身份证背面图片',
  `frsfz_pic` varchar(150) NOT NULL COMMENT '法人或个人手持身份证图片',
  `zhizhao` varchar(150) NOT NULL COMMENT '营业执照图片',
