  `qht` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1：已签署合同  0：未签署合同',
  `state` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付保证金状态 1：已支付 0：未支付',
  `complete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1：完成  0：未完成',
  `apply_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1:企业入驻 2:个人入驻 3:网红入驻',
  `apply_time` int(10) unsigned NOT NULL COMMENT '申请时间',
  `checked_time` int(10) unsigned DEFAULT NULL COMMENT '审核时间',
  `qht_time` int(10) unsigned DEFAULT NULL COMMENT '签合同时间',
  `pay_time` int(10) unsigned DEFAULT NULL COMMENT '支付时间',
  `complete_time` int(10) unsigned DEFAULT NULL COMMENT '完成时间',
  `remarks` varchar(100) DEFAULT NULL COMMENT '审核未通过原因',
  `user_id` int(11) unsigned NOT NULL COMMENT '关联用户id',
  `shop_id` int(10) unsigned DEFAULT NULL COMMENT '商家id',
  `settlement_date` int(11) NOT NULL DEFAULT '15' COMMENT '结算日期',
  `service_rate` char(10) NOT NULL DEFAULT '0' COMMENT '服务费率',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
