-- Table structure for sp_detail
-- ----------------------------
DROP TABLE IF EXISTS `sp_detail`;
CREATE TABLE `sp_detail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `de_type` tinyint(1) unsigned NOT NULL COMMENT '明细状态：1 ：收入  2：支出',
  `sr_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '收入渠道：1：订单分成  2：订单退款 3邀请注册 4 礼物分成  5充值  6余额提现拒绝  7代理余额提现拒绝 8品牌使用费转账  9品牌使用费兑换购物券  10管理奖兑换购物券  11进货付款提交凭证增加信用值 12直推管理奖 13直推购物券奖励  14极差管理奖  15极差购物奖    58后台充值品牌使用值  20注册赠送品牌使用值  21订货增加库存  22后台强制成交增加信用值   23后台强制成交订货增加库存  24后台增加燃料费  25后台添加KLG     26兑换实物获得KLG  60KLG转乐购分   17抢购冻结增加冻结乐购分   61平台寄售冻结乐购分  63进货转出售获得乐购分  64直推奖励KLG  65等级奖励KLG   66分割发货奖励KLG  80挂售管理奖  90注册保证金',
  `zc_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支出渠道：1：提现   2：支付订单 3 打赏礼物 4管理奖兑换扣管理奖 5品牌使用费转账 6品牌使用费兑换购物券   7管理奖兑换购物券 8管理奖兑换扣品牌使用费 9成功交易扣除出售者相应获得利润的百分比品牌使用值  10预定成功扣除品牌使用费  11后台匹配成功扣除买家品牌使用费  59后台充值品牌使用值  12违规罚自己  13下级违规  14进货转出售扣库存   15后台强制成交扣品牌使用费  16兑换实物酒扣库存  17抢购冻结扣除乐购分  24后台乐购分  25后台添加KLG 60KLG转乐购分     61平台寄售乐购分  63进货转出售释放冻结乐购分',
  `price` decimal(10,2) NOT NULL COMMENT '明细金额',
  `order_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1:商品订单 2：虚拟商品订单 3：入驻订单  4：商品退款订单 100课程订单',
  `order_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商品订单id',
  `tx_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '提现id',
  `user_id` int(11) unsigned NOT NULL COMMENT '用户id',
  `wat_id` int(11) unsigned NOT NULL COMMENT '用户钱包id',
  `time` int(11) unsigned NOT NULL COMMENT '时间',
  `agent_profit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理利润',
  `agent_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '代理类型',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `target_id` int(11) NOT NULL DEFAULT '0' COMMENT '目标用户ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=107 DEFAULT CHARSET=utf8 COMMENT='用户钱包明细表';

