  `mid` int(10) NOT NULL COMMENT '会员id',
  `describe` varchar(1024) DEFAULT NULL COMMENT '描述',
  `tags` varchar(64) DEFAULT NULL COMMENT '标签',
  `gid` int(10) NOT NULL COMMENT '商品id',
  `createtime` int(11) DEFAULT NULL COMMENT '创建时间',
