  `ishot` tinyint(1) DEFAULT '0' COMMENT '是否设置热门1热门',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单id',
  `star` tinyint(2) NOT NULL DEFAULT '5' COMMENT '评分，最高5星，默认5星',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `mid` (`mid`) USING BTREE,
