  `attr_id` int(10) unsigned NOT NULL COMMENT '关联属性id',
  `attr_value` varchar(150) NOT NULL COMMENT '属性值',
  `attr_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '属性价格',
  `attr_pic` varchar(100) DEFAULT NULL COMMENT '属性图像',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `attr_id` (`attr_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1639 DEFAULT CHARSET=utf8 COMMENT='商品属性值表';

