-- ----------------------------
-- Table structure for sp_group_buy
-- ----------------------------
DROP TABLE IF EXISTS `sp_group_buy`;
CREATE TABLE `sp_group_buy` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(50) NOT NULL COMMENT '团购标题名称',
  `start_time` int(11) unsigned NOT NULL COMMENT '团购开始时间',
  `end_time` int(11) unsigned NOT NULL COMMENT '团购结束时间',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `goods_attr` varchar(100) NOT NULL COMMENT '商品属性id集合以逗号隔开',
  `price` decimal(10,2) NOT NULL COMMENT '团购价格',
  `remark` varchar(150) DEFAULT NULL COMMENT '团购活动介绍',
  `apply_time` int(10) unsigned NOT NULL COMMENT '申请时间',
  `checked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态 0：待审核 1：已通过 2：平台关闭',
  `refuse_remarks` varchar(150) DEFAULT NULL COMMENT '平台拒绝理由',
  `checked_time` int(10) unsigned DEFAULT NULL COMMENT '审核时间',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商家id',
  `recommend` tinyint(1) DEFAULT '0' COMMENT '0:不推荐 1:已推荐',
  `hd_bs` tinyint(1) NOT NULL DEFAULT '0' COMMENT '活动标识 0：未开始 1：活动中 2：已结束',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:正常 0:删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `shop_id` (`shop_id`) USING BTREE,
  KEY `start_time` (`start_time`) USING BTREE,
  KEY `end_time` (`end_time`) USING BTREE,
  KEY `recommend` (`recommend`) USING BTREE,
  KEY `apply_time` (`apply_time`) USING BTREE,
  KEY `checked` (`checked`) USING BTREE,
  KEY `is_show` (`is_show`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='团购活动表';

-- ----------------------------
-- Records of sp_group_buy
-- ----------------------------

