DROP TABLE IF EXISTS `sp_group_travel`;
CREATE TABLE `sp_group_travel` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `active_name` varchar(20) COLLATE utf8mb4_bin NOT NULL COMMENT '活动名称',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品id',
  `goods_attr` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '商品属性id集合以逗号隔开 ',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '费用',
  `people_num` int(3) DEFAULT '0' COMMENT '团人数',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '商家id',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1进行中 0已结束',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:正常 0:删除 ',
  `start_time` int(11) DEFAULT NULL COMMENT '报名开始时间',
  `end_time` int(11) DEFAULT NULL COMMENT '报名结束时间',
  `leave_time` int(11) DEFAULT NULL COMMENT '出发时间',
  `apply_num` int(7) NOT NULL DEFAULT '0' COMMENT '报名人数',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

