  `onclick` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品浏览量',
  `sale_num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已售量',
  `sort` int(11) unsigned NOT NULL DEFAULT '500' COMMENT '商品排序',
  `fictitious_sale_num` int(10) NOT NULL DEFAULT '0' COMMENT '虚拟销量',
  `is_recycle` tinyint(1) NOT NULL DEFAULT '0' COMMENT '回收站',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `shop_price` (`shop_price`) USING BTREE,
  KEY `onsale` (`onsale`) USING BTREE,
  KEY `goods_name` (`goods_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=913 DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of sp_integral_goods
