-- ----------------------------
-- Table structure for sp_member
-- ----------------------------
DROP TABLE IF EXISTS `sp_member`;
CREATE TABLE `sp_member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户名',
  `recode` varchar(150) NOT NULL COMMENT '推广码',
  `phone` varchar(50) DEFAULT NULL COMMENT '手机',
  `integral` int(11) NOT NULL DEFAULT '0' COMMENT '积分',
  `fans_integral` int(11) DEFAULT '0' COMMENT '粉丝积分',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `summary` text COMMENT '个人简介',
  `paypwd` varchar(50) DEFAULT NULL COMMENT '支付密码',
  `appinfo_code` varchar(150) DEFAULT NULL COMMENT '推送别名',
  `headimgurl` varchar(255) DEFAULT NULL COMMENT '头像地址',
  `xieyi` tinyint(1) unsigned NOT NULL COMMENT '1:同意协议 0:拒绝协议',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0: 未知 1：男 2：女',
  `birth` int(10) unsigned DEFAULT NULL COMMENT '生日',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `wxnum` varchar(50) DEFAULT NULL COMMENT '微信号',
  `qqnum` varchar(50) DEFAULT NULL COMMENT 'qq号',
  `oauth` tinyint(1) unsigned DEFAULT '0' COMMENT '第三方登录标识 1:微信登录',
  `openid` varchar(150) DEFAULT NULL COMMENT '用户openid',
  `regtime` int(11) unsigned NOT NULL COMMENT '注册时间',
  `qrcodeurl` varchar(255) NOT NULL,
  `agent_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '代理等级0:普通用户  1:区代  2:县代  3:市代  4:省代  5:总代',
  `false_agent_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '假代理等级0:普通用户  1:V1  2:V2  3:V3  4:V4  5:V5',
  `agent_num` int(11) NOT NULL DEFAULT '0' COMMENT '代理数量',
  `direct_agent_num` int(11) NOT NULL DEFAULT '0' COMMENT '直推代理数',
  `is_vip_two` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'vip的第二等级 运营商',
  `time_out` int(11) DEFAULT NULL,
  `one_level` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '一级上线id',
  `two_level` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '两级上线id',
  `team_id` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT '团队ID',
  `checked` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1:开启 0:关闭',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联商家id',
  `follow` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未关注 1:已关注',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '父级账号id',
  `unionid` varchar(50) DEFAULT NULL COMMENT '微信唯一标识',
  `inviter` int(11) NOT NULL DEFAULT '0' COMMENT '邀请人',
  `online` tinyint(1) DEFAULT '0' COMMENT '0:不在线 1:在线',
  `xcx_openid` varchar(50) DEFAULT NULL COMMENT '小程序openid',
  `wx_openid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '公众号openid',
  `portal_openid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '门户小程序openid',
  `level` int(1) unsigned zerofill DEFAULT '0' COMMENT '会员类别(0.普通会员 1.掌柜会员 2.东家会员)',
  `soldier` int(1) DEFAULT '0' COMMENT '军人标识 0非军人 1-5军区标识',
  `frozen` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:不冻结  1:短期冻结  2:长期冻结',
  `pc_account` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'pc账号',
  `pc_pass` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'pc密码',
  `member_recode` varchar(125) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `emergency_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '紧急联系人姓名',
  `emergency_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '紧急联系人手机',
  `login_code` varchar(125) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '登录识别码',
  `bespoke_proof` int(11) NOT NULL DEFAULT '0' COMMENT '预定提交凭证数',
  `add_way` int(1) DEFAULT '0' COMMENT '0前台添加  1后台添加',
  `admin_id` int(11) DEFAULT '0',
  `vip_time` int(11) DEFAULT NULL COMMENT 'VIP到期时间',
  `order_num` int(11) DEFAULT '0' COMMENT '抢购订单数',
  `reg_enable` tinyint(1) DEFAULT '0' COMMENT '1激活',
  `reg_enable_deposit` decimal(10,2) DEFAULT '0.00' COMMENT '激活保证金',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `recode` (`recode`) USING BTREE,
  UNIQUE KEY `login_code` (`login_code`) USING BTREE,
  UNIQUE KEY `phone` (`phone`) USING BTREE,
  UNIQUE KEY `openid` (`openid`) USING BTREE,
  UNIQUE KEY `pc_account` (`pc_account`) USING BTREE,
  UNIQUE KEY `member_recode` (`member_recode`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8244 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of sp_member
-- ----------------------------

