-- ----------------------------
-- Table structure for sp_member_coupon
-- ----------------------------
DROP TABLE IF EXISTS `sp_member_coupon`;
CREATE TABLE `sp_member_coupon` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) NOT NULL COMMENT '优惠券id',
  `is_sy` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0：未使用 1：已使用',
  `shop_id` int(11) NOT NULL COMMENT '商家id',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  PRIMARY KEY (`id`) USING BTREE
