-- ----------------------------
-- Table structure for sp_order
-- ----------------------------
DROP TABLE IF EXISTS `sp_order`;
CREATE TABLE `sp_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ordernumber` varchar(100) NOT NULL COMMENT '订单号',
  `contacts` varchar(50) NOT NULL COMMENT '收货人',
  `telephone` varchar(32) NOT NULL COMMENT '手机号',
  `pro_id` int(10) unsigned NOT NULL COMMENT '省份id',
  `city_id` int(10) unsigned NOT NULL COMMENT '城市id',
  `area_id` int(10) unsigned NOT NULL COMMENT '区县id',
  `province` varchar(32) NOT NULL COMMENT '省份',
  `city` varchar(32) NOT NULL COMMENT '城市',
  `area` varchar(32) NOT NULL COMMENT '区县',
  `address` varchar(150) NOT NULL COMMENT '详细地址',
  `dz_id` int(10) unsigned NOT NULL COMMENT '地址id',
  `goods_price` decimal(10,2) NOT NULL COMMENT '商品总价',
  `freight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `youhui_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠总金额',
  `coupon_id` int(11) NOT NULL DEFAULT '0' COMMENT '优惠券id',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券抵扣',
  `coupon_str` varchar(100) DEFAULT NULL COMMENT '使用优惠券详细',
  `integral` int(10) unsigned DEFAULT '0' COMMENT '使用积分',
  `integral_money` decimal(10,2) DEFAULT '0.00' COMMENT '使用积分抵多少钱',
  `total_price` decimal(10,2) NOT NULL COMMENT '总价',
  `onefen_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分销一级上级id',
  `twofen_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分销二级上线id',
  `onefen_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '一级上线分销金额',
  `twofen_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '二级上线分销金额',
  `beizhu` varchar(150) DEFAULT NULL COMMENT '备注',
  `state` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态 0：未支付 1：已支付',
  `zf_type` tinyint(1) unsigned DEFAULT '0' COMMENT '支付类型：1：微信支付  2：支付宝支付,3：余额支付，4：朋友代付',
  `pay_time` int(10) unsigned DEFAULT NULL COMMENT '支付时间',
  `fh_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0：未发货，1：已发货',
  `fh_time` int(11) unsigned DEFAULT NULL COMMENT '发货时间',
  `settle_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '结算状态0未结算 1 结算 在订单确认收货的时候结算',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未确认收货，1：已确认收货  2：已关闭',
  `dakuan_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未向商家打款 1:已向商家打款',
  `dakuan_time` int(10) unsigned DEFAULT NULL COMMENT '打款时间',
  `shouhou` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1:存在订单商品在售后中  0：正常',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:显示 0:删除',
  `coll_time` int(10) unsigned DEFAULT NULL COMMENT '收货时间',
  `can_time` int(10) unsigned DEFAULT NULL COMMENT '取消时间',
  `del_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  `ping_extend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:待追评 1:已追评',
  `ping` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:待评价 1:已评价',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `zong_id` int(10) unsigned NOT NULL COMMENT '总订单id',
  `order_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1:正常订单  2:拼团订单 3积分商城订单 4组团游',
  `fictitious_material` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1:虚拟  2:实物',
  `pin_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1:拼团团长 2:拼团团员',
  `pin_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '拼团id',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商铺id',
  `addtime` int(10) unsigned NOT NULL COMMENT '添加时间',
  `zdsh_time` int(10) unsigned DEFAULT NULL COMMENT '自动收货时间',
  `time_out` int(11) unsigned NOT NULL COMMENT '订单过期时间',
  `p_fh_status` tinyint(1) DEFAULT '0' COMMENT '发货到平台-发货状态0：未发货，1：已发货',
  `p_fh_time` int(11) DEFAULT NULL COMMENT '发货到平台-发货时间',
  `p_zdsh_time` int(11) DEFAULT NULL COMMENT '平台自动收货时间',
  `o_state` int(10) DEFAULT '0' COMMENT '0-待商家发货，1-商家已发货（等待平台确认），2平台确认（待平台发货），3平台已发货（等待用户收货），4-用户已收货（订单完成），5申请退款（平台），6申请退货（平台），6平台确认（待打款），7已打款（用户确认），8-用户已发货（平台确认收货），9平台已收货，10平台发货（商户确认收货）11 平台已发货，待商家收货',
  `profile` varchar(255) DEFAULT NULL COMMENT '旅游产品订单的用户数据信息',
  `is_use` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未使用 1使用',
  `proof_img` varchar(255) DEFAULT NULL COMMENT '凭证图',
  `proof_state` int(11) NOT NULL DEFAULT '0' COMMENT '0未上传   1已上传   2被拒绝',
  `proof_reply` varchar(255) DEFAULT NULL COMMENT '凭证回复',
  `logistics` longtext,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `order_number` (`ordernumber`) USING BTREE,
  KEY `pro_id` (`pro_id`) USING BTREE,
  KEY `city_id` (`city_id`) USING BTREE,
  KEY `area_id` (`area_id`) USING BTREE,
  KEY `state` (`state`) USING BTREE,
  KEY `zf_type` (`zf_type`) USING BTREE,
  KEY `fh_status` (`fh_status`) USING BTREE,
  KEY `order_status` (`order_status`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE,
  KEY `shop_id` (`shop_id`) USING BTREE,
  KEY `dakuan_status` (`dakuan_status`) USING BTREE,
  KEY `shouhou` (`shouhou`) USING BTREE,
  KEY `zong_id` (`zong_id`) USING BTREE,
  KEY `is_show` (`is_show`) USING BTREE,
  KEY `order_type` (`order_type`) USING BTREE,
  KEY `pin_type` (`pin_type`) USING BTREE,
  KEY `pin_id` (`pin_id`) USING BTREE,
  KEY `ping` (`ping`) USING BTREE,
  KEY `zdsh_time` (`zdsh_time`) USING BTREE,
  KEY `time_out` (`time_out`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8 COMMENT='订单表';

-- ----------------------------
-- Records of sp_order
-- ----------------------------

-- ----------------------------
-- Table structure for sp_order_assemble
-- ----------------------------
DROP TABLE IF EXISTS `sp_order_assemble`;
CREATE TABLE `sp_order_assemble` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pin_type` tinyint(1) unsigned NOT NULL COMMENT '1：团长  2：团成员',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `goods_attr` varchar(100) NOT NULL COMMENT '商品单选属性组合以英文逗号隔开',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商家id',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `hd_id` int(10) unsigned NOT NULL COMMENT '拼团活动id',
  `pin_id` int(10) unsigned NOT NULL COMMENT '拼团流水id',
  `order_id` int(10) unsigned NOT NULL COMMENT '订单id',
  `state` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未支付 1:已支付',
  `tui_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '退款状态 0：正常 1：开启退款状态',
  `dakuan_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '打款状态 0：未打款  1：已打款',
  `dakuan_time` int(10) unsigned DEFAULT NULL COMMENT '给用户钱包打款时间',
  `addtime` int(10) unsigned NOT NULL COMMENT '拼团时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `order_id` (`order_id`) USING BTREE,
  KEY `pin_type` (`pin_type`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE,
  KEY `pin_id` (`pin_id`) USING BTREE,
  KEY `th_status` (`tui_status`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `shop_id` (`shop_id`) USING BTREE,
  KEY `hd_id` (`hd_id`) USING BTREE,
  KEY `state` (`state`) USING BTREE,
  KEY `dakuan_status` (`dakuan_status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='拼团明细表';

-- ----------------------------
-- Records of sp_order_assemble
-- ----------------------------

-- ----------------------------
-- Table structure for sp_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `sp_order_goods`;
CREATE TABLE `sp_order_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) unsigned NOT NULL COMMENT '商品id',
  `goods_name` varchar(50) NOT NULL COMMENT '商品名称',
  `thumb_url` varchar(150) NOT NULL COMMENT '商品缩略图',
  `goods_attr_id` varchar(150) DEFAULT NULL COMMENT '商品属性id组合',
  `goods_attr_str` varchar(150) DEFAULT NULL COMMENT '属性字符串',
  `real_price` decimal(10,2) NOT NULL COMMENT '商品原价',
  `price` decimal(10,2) NOT NULL COMMENT '商品实价',
  `goods_num` int(10) unsigned NOT NULL COMMENT '购买数量',
  `hd_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0：默认  1：秒杀 2：团购  3：拼团',
  `hd_id` int(11) NOT NULL DEFAULT '0' COMMENT '活动id',
  `prom_id` int(11) NOT NULL DEFAULT '0' COMMENT '促销活动id',
  `prom_str` varchar(100) DEFAULT NULL COMMENT '活动说明',
  `is_free` tinyint(1) unsigned NOT NULL COMMENT '0:不包邮 1:包邮',
  `th_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '退换状态 0：正常 1：退款申请中  2：退款中 3：平台拒绝退款  4：退款完成  5：换货申请中  6：换货中  7：平台拒绝换货   8：换货完成',
  `ping_extend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:待追评 1:已追评',
  `ping` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:待评价 1:已评价',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商家id',
  `order_id` int(10) unsigned NOT NULL COMMENT '订单id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `th_status` (`th_status`) USING BTREE,
  KEY `order_id` (`order_id`) USING BTREE,
  KEY `shop_id` (`shop_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=828 DEFAULT CHARSET=utf8 COMMENT='订单商品表';

