CREATE TABLE `sp_order_log` (
  `logid` int(11) NOT NULL AUTO_INCREMENT,
  `orderid` int(11) DEFAULT NULL COMMENT '订单id',
  `status` int(10) DEFAULT NULL COMMENT '操作状态',
  `user` varchar(255) DEFAULT NULL,
  `business` varchar(255) DEFAULT NULL,
  `platform` varchar(255) DEFAULT NULL,
  `adddate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `addtime` int(11) DEFAULT NULL,
  PRIMARY KEY (`logid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sp_order_log
-- ----------------------------

-- ----------------------------
-- Table structure for sp_order_timeout
-- ----------------------------
DROP TABLE IF EXISTS `sp_order_timeout`;
CREATE TABLE `sp_order_timeout` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `normal_out_order` int(10) unsigned NOT NULL COMMENT '普通订单关闭时间(小时)',
  `rushactivity_out_order` int(10) unsigned NOT NULL COMMENT '秒杀订单关闭时间(分钟)',
  `group_out_order` int(10) unsigned NOT NULL COMMENT '团购订单关闭时间(分钟)',
  `assemorder_timeout` int(10) unsigned NOT NULL COMMENT '拼团订单自动关闭时间（分钟）',
  `assem_timeout` int(10) unsigned NOT NULL COMMENT '拼团订单未成团过期关闭时间(小时)',
  `zdqr_sh_time` int(10) unsigned NOT NULL COMMENT '过期自动确认收货时间（天）',
