-- ----------------------------
-- Table structure for sp_rush_activity
-- ----------------------------
DROP TABLE IF EXISTS `sp_rush_activity`;
CREATE TABLE `sp_rush_activity` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `activity_name` varchar(32) NOT NULL COMMENT '活动名称',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `goods_attr` varchar(50) NOT NULL COMMENT '商品属性组合',
  `price` decimal(10,2) NOT NULL COMMENT '抢购价格',
  `num` int(10) unsigned NOT NULL COMMENT '抢购总量',
  `xznum` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '限购数量',
  `kucun` int(11) NOT NULL COMMENT '库存',
  `start_time` int(10) unsigned NOT NULL COMMENT '开始时间',
  `end_time` int(10) unsigned NOT NULL COMMENT '结束时间',
  `checked` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '审核状态 0：待审核 1：已通过  2：平台关闭',
  `sold` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '已售数量',
  `recommend` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:不推荐 1:已推荐',
  `remark` varchar(150) DEFAULT NULL COMMENT '抢购描述',
  `apply_time` int(10) unsigned NOT NULL COMMENT '申请时间',
  `checked_time` int(10) unsigned DEFAULT NULL COMMENT '审核时间',
  `refuse_remarks` varchar(150) DEFAULT NULL COMMENT '拒绝理由',
  `hd_bs` tinyint(1) NOT NULL DEFAULT '0' COMMENT '活动标识 0：未开始 1：活动中 2：已结束',
  `is_show` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:正常 0:删除',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商铺id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `goods_id` (`goods_id`) USING BTREE,
  KEY `shop_id` (`shop_id`) USING BTREE,
  KEY `start_time` (`start_time`) USING BTREE,
  KEY `end_time` (`end_time`) USING BTREE,
  KEY `apply_time` (`apply_time`) USING BTREE,
  KEY `checked` (`checked`) USING BTREE,
  KEY `is_show` (`is_show`) USING BTREE,
  KEY `goods_attr` (`goods_attr`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

