DROP TABLE IF EXISTS `sp_shops`;
CREATE TABLE `sp_shops` (
  `id` mediumint(10) unsigned NOT NULL AUTO_INCREMENT,
  `shop_name` varchar(32) NOT NULL COMMENT '店铺名称',
  `shop_desc` varchar(150) NOT NULL COMMENT '店铺描述',
  `search_keywords` varchar(255) NOT NULL COMMENT '搜索关键词',
  `indus_id` int(10) unsigned NOT NULL COMMENT '行业id',
  `recode` varchar(150) DEFAULT NULL COMMENT '推广码',
  `contacts` varchar(20) NOT NULL COMMENT '联系人',
  `telephone` varchar(32) NOT NULL COMMENT '联系电话',
  `wxnum` varchar(32) DEFAULT NULL COMMENT '微信',
  `qqnum` varchar(32) DEFAULT NULL COMMENT 'qq',
  `logo` varchar(120) DEFAULT NULL COMMENT '商家logo',
  `service_qrcode` varchar(120) DEFAULT NULL COMMENT '客服二维码',
  `sertime` varchar(100) DEFAULT NULL COMMENT '营业时间',
  `freight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `reduce` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '满多金额免运费',
  `pro_id` int(10) unsigned NOT NULL COMMENT '省id',
  `city_id` int(10) unsigned NOT NULL COMMENT '市id',
  `area_id` int(10) unsigned NOT NULL COMMENT '区或县id',
  `shengshiqu` varchar(100) NOT NULL COMMENT '省市区',
  `address` varchar(50) NOT NULL COMMENT '详细地址',
  `goods_fen` float(2,1) NOT NULL DEFAULT '0.0' COMMENT '宝贝评分',
  `fw_fen` float(2,1) NOT NULL DEFAULT '0.0' COMMENT '服务评分',
  `wuliu_fen` float(2,1) NOT NULL DEFAULT '0.0' COMMENT '物流评分',
  `zonghe_fen` float(2,1) NOT NULL DEFAULT '0.0' COMMENT '综合评分',
  `goods_num` int(11) NOT NULL DEFAULT '0' COMMENT '宝贝数量',
  `sale_num` int(11) NOT NULL DEFAULT '0' COMMENT '店铺销量',
  `deal_num` int(11) NOT NULL DEFAULT '0' COMMENT '店铺成交量',
  `deal_lv` int(11) NOT NULL DEFAULT '0' COMMENT '商家成交率',
  `comment_num` int(11) NOT NULL DEFAULT '0' COMMENT '评论数量',
  `praise_num` int(11) NOT NULL DEFAULT '0' COMMENT '好评数量',
  `praise_lv` int(11) NOT NULL DEFAULT '0' COMMENT '好评率',
  `coll_num` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数量',
  `lng` varchar(32) DEFAULT NULL COMMENT 'lng坐标',
  `lat` varchar(32) DEFAULT NULL COMMENT 'lat坐标',
  `fenxiao` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否支持分销 0：不支持 1：支持',
  `shop_leixing` tinyint(1) NOT NULL DEFAULT '2' COMMENT '1:自营 2:商家',
  `open_status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态：1开启，0关闭',
  `normal` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1:正常 0:注销',
  `addtime` int(10) unsigned NOT NULL,
  `settlement_date` int(11) DEFAULT NULL,
  `service_rate` char(10) DEFAULT NULL,
  `bankcard` varchar(255) DEFAULT NULL,
  `bankname` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `shop_name` (`shop_name`) USING BTREE,
  UNIQUE KEY `recode` (`recode`) USING BTREE,
  KEY `search_keywords` (`search_keywords`) USING BTREE,
  KEY `sale_num` (`sale_num`) USING BTREE,
  KEY `zonghe_fen` (`zonghe_fen`) USING BTREE,
  KEY `deal_num` (`deal_num`) USING BTREE,
  KEY `deal_lv` (`deal_lv`) USING BTREE,
  KEY `comment_num` (`comment_num`) USING BTREE,
  KEY `praise_num` (`praise_num`) USING BTREE,
  KEY `praise_lv` (`praise_lv`) USING BTREE,
  KEY `coll_num` (`coll_num`) USING BTREE,
  KEY `open_status` (`open_status`) USING BTREE,
  KEY `normal` (`normal`) USING BTREE,
  KEY `goods_fen` (`goods_fen`) USING BTREE,
  KEY `fw_fen` (`fw_fen`) USING BTREE,
  KEY `wuliu_fen` (`wuliu_fen`) USING BTREE,
  KEY `goods_num` (`goods_num`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='入驻商家表';

