  `signold_price` int(11) NOT NULL DEFAULT '0' COMMENT '补签扣除(每天/次)',
  `signold_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '补签扣除类型 0 余额 1 积分',
  `textsign` varchar(255) NOT NULL DEFAULT '' COMMENT '自定义 签到',
  `textsignold` varchar(255) NOT NULL DEFAULT '' COMMENT '自定义 补签',
  `textsigned` varchar(255) NOT NULL DEFAULT '' COMMENT '自定义 已签',
  `textsignforget` varchar(255) NOT NULL DEFAULT '' COMMENT '自定义 漏签',
  `maincolor` varchar(20) NOT NULL DEFAULT '' COMMENT '签到页面主色调',
  `cycle` tinyint(3) NOT NULL DEFAULT '0' COMMENT '签到周期 0 不限 1 自然月',
  `reward_default_first` int(11) NOT NULL DEFAULT '0' COMMENT '首次奖励',
  `reward_default_day` int(11) NOT NULL DEFAULT '0' COMMENT '日常奖励',
  `reword_order` text NOT NULL COMMENT '连签奖励规则',
  `reword_sum` text NOT NULL COMMENT '总签奖励规则',
  `reword_special` text NOT NULL COMMENT '特殊奖励规则',
  `sign_rule` text NOT NULL COMMENT '签到规则 说明',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

