-- ----------------------------
-- Table structure for sp_th_apply
-- ----------------------------
DROP TABLE IF EXISTS `sp_th_apply`;
CREATE TABLE `sp_th_apply` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `th_number` varchar(100) NOT NULL COMMENT '退换订单号',
  `thfw_id` int(10) unsigned NOT NULL COMMENT '退换服务方式id',
  `order_id` int(10) unsigned NOT NULL COMMENT '订单id',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `shop_id` int(10) unsigned NOT NULL COMMENT '商铺id',
  `orgoods_id` int(10) unsigned NOT NULL COMMENT '订单商品id',
  `sh_type` tinyint(1) unsigned NOT NULL COMMENT '收货：1:未收货 2:已收货',
  `th_reason` varchar(100) NOT NULL COMMENT '退换原因',
  `th_content` varchar(255) NOT NULL COMMENT '退换说明',
  `tui_price` decimal(15,2) NOT NULL DEFAULT '0.00',
  `tui_num` int(10) unsigned NOT NULL COMMENT '退换数量',
  `contacts` varchar(50) DEFAULT NULL COMMENT '收货人姓名',
  `telephone` varchar(32) DEFAULT NULL COMMENT '联系电话',
  `dz_id` int(10) unsigned DEFAULT NULL COMMENT '地址id',
  `pro_id` int(10) unsigned DEFAULT NULL COMMENT '省份id',
  `city_id` int(10) unsigned DEFAULT NULL COMMENT '城市id',
  `area_id` int(10) unsigned DEFAULT NULL COMMENT '区域id',
  `province` varchar(50) DEFAULT NULL COMMENT '省份',
  `city` varchar(50) DEFAULT NULL COMMENT '城市',
  `area` varchar(50) DEFAULT NULL COMMENT '区县',
  `shengshiqu` varchar(100) DEFAULT NULL COMMENT '省市区',
  `address` varchar(100) DEFAULT NULL COMMENT '详细地址',
  `apply_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态：0：待平台同意  1：平台已同意  2：平台拒绝  3：已完成  4：用户撤销',
  `apply_time` int(10) unsigned NOT NULL COMMENT '申请时间',
  `agree_time` int(11) unsigned DEFAULT NULL COMMENT '同意时间',
  `refuse_time` int(10) unsigned DEFAULT NULL COMMENT '平台拒绝时间',
  `refuse_reason` varchar(100) DEFAULT NULL COMMENT '平台拒绝原因',
  `dcfh_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户发货状态 0：未发货  1：已发货',
  `dcfh_time` int(10) unsigned DEFAULT NULL COMMENT '用户发货时间',
  `sh_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '平台收货状态 0：未收货  1：已收货',
  `sh_time` int(10) unsigned DEFAULT NULL COMMENT '平台收货时间',
  `fh_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '平台发货状态 0：未发货  1：已发货',
  `fh_time` int(10) unsigned DEFAULT NULL COMMENT '平台发货时间',
  `shou_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '用户收货状态 0：未收货  1：已收货',
  `shou_time` int(10) unsigned DEFAULT NULL COMMENT '用户收货时间',
  `che_time` int(10) unsigned DEFAULT NULL COMMENT '用户撤销时间',
  `com_time` int(10) unsigned DEFAULT NULL COMMENT '完成时间',
  `check_timeout` int(10) unsigned NOT NULL COMMENT '商家审核过期时间',
  `shoptui_timeout` int(10) unsigned DEFAULT NULL COMMENT '商家退款过期时间',
  `yhfh_timeout` int(11) unsigned DEFAULT NULL COMMENT '用户发货过期时间',
  `yhshou_timeout` int(10) unsigned DEFAULT NULL COMMENT '用户确认收货过期时间',
  `dakuan_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0:未向用户钱包打款1：已向用户钱包打款',
  `dakuan_time` int(10) unsigned DEFAULT NULL COMMENT '打款时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `th_number` (`th_number`) USING BTREE,
  KEY `thfw_id` (`thfw_id`) USING BTREE,
  KEY `orgoods_id` (`orgoods_id`) USING BTREE,
  KEY `order_id` (`order_id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `apply_status` (`apply_status`) USING BTREE,
  KEY `dcfh_status` (`dcfh_status`) USING BTREE,
  KEY `sh_status` (`sh_status`) USING BTREE,
  KEY `fh_status` (`fh_status`) USING BTREE,
  KEY `shou_status` (`shou_status`) USING BTREE,
  KEY `apply_time` (`apply_time`) USING BTREE,
  KEY `check_timeout` (`check_timeout`) USING BTREE,
  KEY `shoptui_timeout` (`shoptui_timeout`) USING BTREE,
  KEY `yhfh_timeout` (`yhfh_timeout`) USING BTREE,
  KEY `yhshou_timeout` (`yhshou_timeout`) USING BTREE,
  KEY `dakuan_status` (`dakuan_status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=utf8;

