-- ----------------------------
-- View structure for v_fen_orders_tui
-- ----------------------------
DROP VIEW IF EXISTS `v_fen_orders_tui`;
CREATE ALGORITHM=UNDEFINED DEFINER=`zunyi1935_meitao`@`%` SQL SECURITY DEFINER VIEW `v_fen_orders_tui` AS select distinct `o`.`id` AS `id`,`o`.`total_price` AS `total_price`,`o`.`onefen_id` AS `onefen_id`,`o`.`onefen_price` AS `onefen_price`,`o`.`ordernumber` AS `ordernumber`,`o`.`state` AS `state`,`o`.`order_status` AS `order_status`,`o`.`fh_status` AS `fh_status`,`o`.`addtime` AS `addtime`,1 AS `tui_status` from (`sp_order` `o` join `sp_th_apply` `t`) where ((`o`.`onefen_id` > 0) and `o`.`id` in (select `sp_th_apply`.`order_id` from `sp_th_apply`)) ;

-- ----------------------------
-- View structure for v_kefu
-- ----------------------------
DROP VIEW IF EXISTS `v_kefu`;
CREATE ALGORITHM=UNDEFINED DEFINER=`zunyi1935_meitao`@`%` SQL SECURITY DEFINER VIEW `v_kefu` AS select `r`.`user_id` AS `user_id`,`r`.`token` AS `token`,`m`.`user_name` AS `user_name`,`m`.`headimgurl` AS `headimgurl`,`m`.`phone` AS `phone`,`m`.`pid` AS `pid`,(select `sp_member`.`shop_id` from `sp_member` where (`sp_member`.`id` = `m`.`pid`)) AS `shopid` from (`sp_rxin` `r` left join `sp_member` `m` on((`r`.`user_id` = `m`.`id`))) where (`m`.`pid` > 0) ;

-- ----------------------------
-- View structure for v_member_token
-- ----------------------------
DROP VIEW IF EXISTS `v_member_token`;
CREATE ALGORITHM=UNDEFINED DEFINER=`zunyi1935_meitao`@`%` SQL SECURITY DEFINER VIEW `v_member_token` AS select `m`.`user_name` AS `user_name`,`m`.`id` AS `id`,`m`.`phone` AS `phone`,`m`.`appinfo_code` AS `appinfo_code`,`r`.`token` AS `token`,`m`.`shop_id` AS `shop_id` from (`sp_member` `m` left join `sp_rxin` `r` on((`m`.`id` = `r`.`user_id`))) ;
