INSERT INTO `sp_news` VALUES ('40', '隐私政策', null, '0', '1', '', '', '', '', '<p>&nbsp; &nbsp; 欢迎您使用遵义1935！快乐购信息科技有限公司（以下简称“我们”）重视用户的隐私。您在使用我们的服务时，我们可能会收集和使用您的相关信息。我们希望通过本《隐私政策》向您说明，在使用我们的服务时，我们如何收集、使用、储存和分享这些信息，以及我们为您提供的访问、更新、控制和保护这些信息的方式。本《隐私政策》与您所使用的服务息息相关，希望您仔细阅读，在需要时，按照本《隐私政策》的指引，作出您认为适当的选择。。</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 您使用或继续使用我们的服务，即意味着同意我们按照本《隐私政策》收集、使用、储存和分享您的相关信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp;</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 一、我们如何收集和使用您的个人信息</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、我们提供服务时，可能会收集、储存和使用下列与您有关的信息。如果您不提供相关信息，可能无法享受我们提供的某些服务，或者无法达到相关服务拟达到的效果。我们会遵循正当、合法、必要的原则，出于本政策所述的以下目的，收集和使用您在使用产品与/或服务过程中主动提供或因使用产品与/或服务而产生的个人信息，以及从第三方获取您的相关个人信息。如果我们要将您的个人信息用于本政策未载明的其它用途，或将基于特定目的收集而来的信息用于其他目的，我们将以合理的方式向您告知，并在使用前再次征得您的同意。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2、您须授权我们收集和使用您个人信息的情形</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 3、我们的产品与/或服务包括一些核心功能，这些功能包含了实现网上交易所必须的功能及保障交易安全所必须的功能。我们可能会收集、保存和使用下列与您有关的信息才能实现上述这些功能。如果您不提供相关信息，您将无法享受我们提供的产品与/或服务。具体：（1）账户注册、登录与验证 （2）商品或服务信息 （3）预约及订单管理 （4）支付功能 （5）交付产品与/或服务功能 （6）客服与售后功能</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4、为保障您使用我们的产品与/或服务时系统的稳定性和安全性，防止您的个人信息被非法获取，更准确地预防欺诈和保护账号安全，我们需要收集您的设备信息（设备型号、设备Mac地址、应用进程列表、设备识别码、操作系统及软件版本、设备状态、网络状况）、历史上网记录、日志信息、面部信息、IP地址、位置信息、浏览信息、订单信息、常用软件列表、ssid、wifi信息、电池使用情况来判断您的账号风险，并可能会记录一些我们认为有风险的链接（“URL”）；我们也会收集您的设备信息用于对遵义1935系统问题进行分析、统计流量并排查可能存在的风险，在您选择向我们发送异常信息时予以排查。如果您不提供上述信息，我们则无法在您使用遵义1935服务过程中对您的服务及账号安全进行保护。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 二、您可自主选择提供的个人信息的情形</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、为向您提供更便捷、更优质、个性化的产品及服务，努力提升您的体验，我们在向您提供的以下附加服务中可能会收集和使用您的个人信息。如果您不提供这些信息，不会影响您使用遵义1935的浏览、搜索、交易等基本服务，但您可能无法获得这些附加服务给您带来的用户体验。这些附加服务包括：</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 1）、基于位置信息的个性化推荐功能：我们会收集您的位置信息，（我们仅收集您当时所处的地理位置，但不会将您各时段的位置信息进行结合以判断您的行踪轨迹）来判断您所处的地点，自动为您推荐您所在区域可以交易的产品或服务，例如向您推荐距离您最近的门店，以及门店内可销售的商品。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、基于摄像头（相机）的附加服务：您可以使用这项扩展功能完成拍摄、拍照、扫码以及人脸识别功能。当您使用人脸识别登录时我们会收集您的面部信息，且在您授权范围内限制使用。未来我们可能会将人脸识别为您提供其他产品或服务功能，届时我们会再次与您进行确认。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、基于相册（图片库/视频库）的图片或视频访问及上传的附加服务：您可在开启相册权限后使用该功能上传您的照片/图片/视频，以实现更换头像、发表评论、分享、拍照购物或与客服沟通提供证明等功能。我们可能会通过您所上传的照片/图片/视频来识别您需要交易的商品或服务；或使用包含您所上传照片、图片的评论信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、基于语音技术的相关附加服务：您可在开启麦克风权限后使用麦克风与我们的客服进行咨询和互动。在这些功能中我们会收集您的语音信息以识别您的交易信息，或响应您的客服及争议处理等需求。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、基于通讯录信息的附加服务：在您开启通讯录权限后我们将收集您的通讯录信息以方便您在交易时不需再手动输入您通讯录中联系人的信息，包括您可以直接为通讯录中的联系人手机号进行下单交易。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6）、基于存储权限的附加服务：我们向您申请获取此权限，目的是为了保障客户端的稳定运行。在您开启我们可读取/写入您设备存储的权限后，我们将自您设备存储空间内读取或向其中写入图片、文件、崩溃日志等必要信息，用于向您提供信息发布或在本地记录崩溃日志信息等功能。</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 7）、您理解并同意，上述附加服务可能需要您在您的设备中开启您的位置信息（地理位置）、摄像头（相机）、相册（图片库）、麦克风（语音）、通讯、存储，以实现这些权限所涉及信息的收集和使用。您可在您的设备设置中逐项查看上述权限的状态，并自行决定这些权限随时的开启或关闭。请您注意，您开启任一权限即代表您授权我们可以收集和使用相关个人信息来为您提供对应服务，您一旦关闭任一权限即代表您取消了授权，我们将不再基于对应权限继续收集和使用相关个人信息，也无法为您提供该权限所对应的服务。但是，您关闭权限的决定不会影响此前基于您的授权所进行的信息及使用。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 三、您充分知晓，以下情形中，我们收集、使用个人信息无需征得您的授权同意：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、与国家安全、国防安全有关的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、与公共安全、公共卫生、重大公共利益有关的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、与犯罪侦查、起诉、审判和判决执行等有关的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、所收集的个人信息是个人信息主体或监护人自行向社会公众公开的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6）、从合法公开披露的信息中收集的您的个人信息的，如合法的新闻报道、政府信息公开等渠道；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 7）、根据您的要求签订合同所必需的；</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 8）、用于维护所提供的产品与/或服务的安全稳定运行所必需的，例如发现、处置产品与/或服务的故障；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 9）、为合法的新闻报道所必需的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 10）、学术研究机构基于公共利益开展统计或学术研究所必要，且对外提供学术研究或描述的结果时，对结果中所包含的个人信息进行去标识化处理的；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 四、我们从第三方获得您个人信息的情形：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们可能从第三方获取您授权共享的账户信息（头像、昵称及授权页面提示的其他信息），并在您同意本隐私政策后将您的第三方账户与您的遵义1935账户绑定，使您可以通过第三方账户直接登录并使用我们的产品与/或服务。我们会将依据与第三方的约定、对个人信息来源的合法性进行确认后，在符合相关法律和法规规定的前提下，使用您的这些个人信息。您也可以使用本机号码来快捷登录，我们会将您的网络信息提供给运营商完成注册或登录。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 五、您个人信息使用的规则：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们会根据本隐私政策的约定并为实现我们的产品与/或服务功能对所收集的个人信息进行使用。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、在收集您的个人信息后，我们将通过技术手段对数据进行去标识化处理，去标识化处理的信息将无法识别主体。请您了解并同意，在此情况下我们有权使用已经去标识化的信息；并在不透露您个人信息的前提下，我们有权对用户数据库进行分析并予以商业化的利用。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、在收集您的个人信息后，我们将通过技术手段对数据进行去标识化处理，去标识化处理的信息将无法识别主体。请您了解并同意，在此情况下我们有权使用已经去标识化的信息；并在不透露您个人信息的前提下，我们有权对用户数据库进行分析并予以商业化的利用。</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 4）、我们会对我们的产品与/或服务使用情况进行统计，并可能会与公众或第三方共享这些统计信息，以展示我们的产品与/或服务的整体使用趋势。但这些统计信息不包含您的任何身份识别信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、当我们展示您的个人信息时，我们会采用包括内容替换、匿名处理方式对您的信息进行脱敏，以保护您的信息安全。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6）、当我们要将您的个人信息用于本隐私政策未载明的其它用途时，或基于特定目的收集而来的信息用于其他目的时，会事先征求您的明示同意。请您理解，我们向您提供的产品与/或服务将不断更新变化。如果您选择使用本隐私政策中尚未列明的其他产品与/或服务时，我们会在收集您的个人信息前通过协议、页面提示等方式向您详细说明信息收集的目的、方式、范围并征求您的同意。若您不同意提供前述信息，您可能无法使用该项产品与/或服务，但不影响您使用现有产品与/或服务。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 六、我们如何共享、转让、公开披露您的个人信息：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、1、我们不会与遵义1935以外的任何公司、组织和个人共享您的个人信息，但以下情况除外：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、（1）事先获得您明确的同意或授权；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、（2）根据适用的法律法规、法律程序的要求、强制性的行政或司法要求所必须的情况下进行提供；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、（3）在法律法规允许的范围内，为维护将遵义1935、或遵义1935的关联方或合作伙伴、您或其他遵义1935用户或社会公众利益、财产或安全免遭损害而有必要提供；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、（4） 只有共享您的个人信息，才能实现我们的产品与/或服务的核心功能或提供您需要的服务；</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 6）、（5）应您需求为您处理您与他人的纠纷或争议；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 7）、（6）符合与您签署的相关协议（包括在线签署的电子协议以及相应的平台规则）或其他的法律文件约定所提供；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 8）、（8）基于符合法律法规的社会公共利益而使用。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 9）、2、为实现基于遵义1935账户向您提供相关产品或服务，向您展示可能感兴趣的内容，保护您的账户与交易安全，我们可能会将您的个人信息与我们的关联方共享。我们将会根据本隐私政策的约定与我们的关联方共享您的个人信息，但我们只会共享必要的个人信息，且受本隐私政策中所声明目的的约束。我们的关联方如要改变个人信息的处理目的，将再次征求您的授权同意。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 七、我们可能会向合作伙伴等第三方共享您的订单信息、账户信息、</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、设备信息以及位置信息，以保障为您提供的服务顺利完成。但我们仅会出于合法、正当、必要、特定、明确的目的共享您的个人信息，并且只会共享提供服务所必要的个人信息。我们的合作伙伴无权将共享的个人信息用于任何其他用途。我们的合作伙伴包括以下类型：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、（1）商品或专业技术服务的供应商。我们可能会将您的个人信息共享给支持我们功能的第三方。这些支持包括为我们的供货或提供基础设施技术服务、物流配送服务、支付服务、数据处理等。我们共享这些信息的目的是可以实现我们产品与/或服务的核心交易功能，比如我们必须与物流服务提供商共享您的订单信息才能安排送货；当您下单的商品或服务由供应商直接发货或提供服务时，我们需要将您订单中的交易信息和收货信息共享给供应商，以指示其交付商品或提供服务。</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 3）、（2）第三方商家。我们必须将您的订单信息与交易有关的必要信息与第三方商家共享来实现您向其交易商品或服务的需求，并促使其可以完成后续的售后服务。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、4、为了遵守法律、执行或适用我们的使用条件和其他协议，或者为了保护遵义1935、您或其他遵义1935客户的权利及其财产或安全，比如为防止欺诈等违法活动和减少信用风险，而与其他公司和组织交换信息。不过,这并不包括违反本隐私政策中所作的承诺而为获利目的出售、出租、共享或以其它方式披露的个人信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、我们不会将您的个人信息转让给任何公司、组织和个人，但以下情况除外：1、事先获得您明确的同意或授权；2、根据适用的法律法规、法律程序的要求、强制性的行政或司法要求所必须的情况进行提供；3、符合与您签署的相关协议（包括在线签署的电子协议以及相应的平台规则）或其他的法律文件约定所提供；4、在涉及合并、收购、资产转让或类似的交易时，如涉及到个人信息转让，我们会要求新的持有您个人信息的公司、组织继续受本隐私政策的约束，否则,我们将要求该公司、组织重新向您征求授权同意。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 八、我们仅会在以下情况下，且采取符合业界标准的安全防护措施的前提下，才会公开披露您的个人信息：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、根据您的需求，在您明确同意的披露方式下披露您所指定的个人信息；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、根据法律、法规的要求、强制性的行政执法或司法要求所必须提供您个人信息的情况下，我们可能会依据所要求的个人信息类型和披露方式公开披露您的个人信息。在符合法律法规的前提下，当我们收到上述披露信息的请求时，我们会要求必须出具与之相应的法律文件，如传票或调查函。我们坚信，对于要求我们提供的信息，应该在法律允许的范围内尽可能保持透明。我们对所有的请求都进行了慎重的审查，以确保其具备合法依据，且仅限于执法部门因特定调查目的且有合法权利获取的数据。在法律法规许可的前提下，我们披露的文件均在加密密钥的保护之下。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 九、我们如何保护和保存您的个人信息：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们采取的数据保护技术措施。我们已采取符合业界标准、合理可行的安全防护措施保护您的信息，防止个人信息遭到未经授权访问、公开披露、使用、修改、损坏或丢失。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、我们采取的数据保护管理组织措施。我们建立了行业内先进的以数据为核心、围绕数据生命周期进行的数据安全管理体系，从组织建设、制度设计、人员管理、产品技术等方面多维度提升个人信息的安全性。我们已经设置了个人信息保护专职部门。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、个人信息安全事件的响应。如果我们的物理、技术或管理防护设施遭到破坏，导致信息被非授权访问、公开披露、篡改或毁坏，导致您的合法权益受损的，我们会及时启动应急预案，采取合理救济措施，以尽可能降低对您个人信息和其他权益的影响。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、账户安全风险的自主防范。我们强烈建议您在使用遵义1935平台服务时不要使用非遵义1935平台推荐的通信方式发送您的信息，同时请您使用复杂密码，协助我们保护您的账户安全。在使用遵义1935服务进行网上交易时，您不可避免地要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或联系地址。此外，您也可以通过我们的服务与第三方建立沟通、交流信息或分析内容。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息尤其是您的账户或密码发生泄露，请您立即联络遵义1935客服或遵义1935服务中心以便我们根据您的申请采取相应措施。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、请注意，您在使用我们服务时自愿共享甚至公开分享的信息，可能会涉及您或他人的个人信息甚至个人敏感信息。请您更加谨慎地考虑，是否在使用我们的服务时共享甚至公开分享相关信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 九、您个人信息的保存</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们在中华人民共和国境内运营中收集和产生的个人信息，将存储在中国境内。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、我们只会在达成本政策所述目的所需的期限内保留您的个人信息，除非法律有强制的留存要求，例如《中华人民共和国电子商务法》要求商品和服务信息、交易信息保存时间自交易完成之日起不少于三年。我们判断个人信息的存储期限主要参考以下标准并以其中较长者为准：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、1）完成与您相关的交易目的、维护相应交易及业务记录，以应对您可能的查询或投诉；2）保证我们为您提供服务的安全和质量；3）您是否同意更长的留存期间；4）是否存在关于保留期限的其他特别约定或法律法规规定。在超出保留期间后，我们会根据适用法律的要求删除您的个人信息，或使其匿名化处理。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 十、您如何管理您的个人信息</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、1 访问和更正您的个人信息 除法律法规规定外，您有权随时访问和更正您的个人信息，具体包括：1）登录遵义1935PC端，进入“我的”首页，点击头像后查询、更正个人资料及个人账户相关信息；2）登录遵义1935APP，进入“我的”，点击头像后查询、更正个人资料及个人账户相关信息；进入“我的”后，可查询实名认证、更正绑定手机、登录密码及支付密码相关信息；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、2、删除您的个人信息 您在我们的产品与/或服务页面中可以直接清除或删除的信息，包括订单信息、浏览信息、收货地址信息。在以下情形中，您可以向我们提出删除个人信息的请求：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、（1）如果我们处理个人信息的行为违反法律法规；（2）如果我们收集、使用您的个人信息，却未征得您的同意；（3）如果我们处理个人信息的行为违反了与您的约定；（4）如果您不再使用我们的产品或服务，或您注销了遵义1935账号；（5）如果我们终止服务及运营。若我们决定响应您的删除请求，我们还将同时通知从我们获得您的个人信息的实体，要求其及时删除，除非法律法规另有规定，或这些实体获得您的独立授权。若我们响应您的删除请求，我们不能保证立即从备份系统中删除相应的信息，但会在备份系统更新时删除这些信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4）、改变您授权同意的范围或撤回您的授权 。您可以通过删除信息、关闭设备功能、手机系统设置等方式改变您授权我们继续收集个人信息的范围或撤回您的授权。您也可以通过注销账户的方式，撤回我们继续收集您个人信息的全部授权。请您理解，每个业务功能需要一些基本的个人信息才能得以完成，当您撤回同意或授权后，我们无法继续为您提供撤回同意或授权所对应的服务，也不再处理您相应的个人信息。但您撤回同意或授权的决定，不会影响此前基于您的授权而开展的个人信息处理。</p><p><br/></p><p>&nbsp;&nbsp;</p><p><br/></p><p>&nbsp; 5）、注销账户 。您可以在我们的产品中直接申请注销账户。您可以通过移动端APP访问“我的”完成账户注销。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6）、（1）与个人信息控制者履行法律法规规定的义务相关的；（2）与国家安全、国防安全有关的； （3）与公共安全、公共卫生、重大公共利益有关的；（4）与犯罪侦查、起诉和审判和执行判决等有关的；（5）有充分证据表明您存在主观恶意或滥用权利的；（6）出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；（7）响应您的请求将导致您或其他个人、组织的合法权益受到严重损害的；（8）涉及商业秘密的。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 十一、未成年人的个人信息保护</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们鼓励父母或监护人指导未满十八岁的未成年人使用我们的服务。我们建议未成年人鼓励他们的父母或监护人阅读本《隐私政策》，并建议未成年人在提交的个人信息之前寻求父母或监护人的同意和指导。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2）、我们不会主动直接向未成年人收集其个人信息。对于经监护人同意而收集未成年人个人信息的情况，我们只会在受到法律允许、监护人同意或者保护未成年人所必要的情况下使用、共享、转让或披露此信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3）、如果有事实证明未成年人在未取得监护人同意的情况下注册使用了我们的产品与/或服务，我们会与相关监护人协商，并设法尽快删除相关个人信息。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 十二、本政策如何更新</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、我们可能适时修订本《隐私政策》的条款，该等修订构成本《隐私政策》的一部分。如该等修订造成您在本《隐私政策》下权利的实质减少，我们将在修订生效前通过在主页上显著位置提示或向您发送电子邮件或以其他方式通知您。在该种情况下，若您继续使用我们的服务，即表示同意受经修订的本《隐私政策》的约束</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 十三、如何联系我们</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、如您对本隐私政策或您个人信息的相关事宜或者投诉、举报、有任何问题、意见或建议，请通过以下方式与我们联系。</p><p><br/></p>', '21', '2', 'platform', 'platform', '1644249600', '0', '1');
INSERT INTO `sp_news` VALUES ('41', '用户协议', null, '0', '1', '', '', '', '', '<p>&nbsp; &nbsp; 感谢您成为遵义1935的注册用户。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; &nbsp; &nbsp;《遵义1935用户服务协议》（以下简称“本协议”）是遵义1935的用户（以下简称“用户”或“您”）与遵义1935的运营方，即快乐购信息科技有限公司（以下简称“遵义1935”）之间，就网站交易平台服务等相关事宜共同缔结。本协议具有合同效力，您应当阅读并遵守本协议。请您务必审慎阅读、充分理解各条款内容，特别是以黑体加粗形式提示您注意的条款。如您未满18周岁，请您在法定监护人陪同下仔细阅读并充分理解本协议，并征得法定监护人的同意后下载本软件。遵义1935郑重提醒用户，请勿通过任何第三方平台或工具（包括但不限于微信、QQ、电话）与其他用户进行沟通或进行交易，更不要脱离遵义1935平台直接转账或支付任何款项，以免在交易中被骗导致钱款的损失。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp;</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 一、 协议确认</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、快乐购信息科技有限公司通过互联网向交易双方提供网络交易服务技术平台的撮合服务。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2、您同意并点击确认本协议条款并完成注册程序后，才能成为遵义1935的正式注册用户，并享受本商城提供的各类服务。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3、根据国家法律法规变化及网站运营需要，遵义1935有权对本协议条款不时进行修改，修改后的协议一经发布并经您确认同意后即刻生效，并代替原来的协议。您可在遵义1935随时查阅最新协议。您继续使用遵义1935的行为将视为您接受了遵义1935不时更新的用户服务协议。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4、本协议包括协议正文及所有遵义1935已经发布的，或未来可能发布或更新的各类规则。所有规则为本协议不可分割的组成部分，与本协议正文具有同等法律效力。在您申请注册成为遵义1935注册经销商前，请仔细阅读本协议的正文内容及以上各类规则。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5、在您完成用户注册程序后，即表示您自愿接受本协议，正式成为遵义1935的用户，并认可本协议全部条款内容。若您不同意本协议，或对本协议中的条款存在任何疑问，请您立即停止遵义1935用户注册程序，并可以选择不使用遵义1935的服务。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6、您点击同意本协议后，即视为您确认自己具有享受遵义1935服务、预约商品、下单等相应的权利能力和行为能力，能够独立承担法律责任。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 7、遵义1935保留在法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容、取消交易的权利。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 8、特别说明及风险提示：本app对象只限于遵义1935销售商及各级别代理商（以下统称为“用户”），客户等非特定人群不能参与，冒用他人身份参与的，相关法律责任应由冒用者自行承担，同时对冒用者及因此所导致的持有云仓库存的所有人的损失承担任何责任。同时知晓持有云仓库存委托商城进行撮合交易，可能无法或推迟交易后的风险。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 9、用户明确知晓商城的经营管理的能力或市场竞争所导致系统风险无法撮合交易或网络商城缺货、断货等情况的发生。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 二、账户管理</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、您注册成功后，遵义1935会为您开通一个账户，作为您使用遵义1935服务的唯一身份标识。该账户的所有权归属于遵义1935，您仅拥有使用权。登录账户时，您可以使用您提供或确认的用户名、邮箱、手机号码或遵义1935允许的其他方式作为注册用户名进行登录，但在登录时您必须输入您设定并保管的账户密码。为保护您的权益，您在设定账户的密码时，请勿使用重复性或者连续数字的简单密码。请您对密码加以妥善保管，切勿将密码告知他人，因密码保管不善而造成的所有损失由您自行承担。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、基于位置信息的个性化推荐功能：我们会收集您的位置信息，（我们仅收集您当时所处的地理位置，但不会将您各时段的位置信息进行结合以判断您的行踪轨迹）来判断您所处的地点，自动为您推荐您所在区域可以交易的产品或服务，例如向您推荐距离您最近的门店，以及门店内可销售的商品。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp;2、 遵义1935只允许每位用户使用一个遵义1935软件账户。如有证据证明或遵义1935有理由相信您存在注册或使用多个遵义1935软件账户的情形，遵义1935有权采取冻结或关闭账户、取消订单、拒绝提供服务等措施，如给遵义1935软件及相关方造成损失的，您还应承担赔偿责任。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 3、您可以为您的账户设定昵称，但该昵称不得侵犯他人合法权益。如遵义1935认为您设定的昵称、头像、资料等注册信息及个人信息涉嫌侵犯他人合法权益的，或出现违法和不良信息的，或恶意注册。遵义1935有权终止为您提供服务，并注销您的昵称。若您不再是遵义1935的注册用户，对于您的原注册账户的昵称，遵义1935可以将其开放给任意注册用户。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4、您对通过您的账户所进行的活动、行为和事件依法享有权利和承担责任，且不得以任何形式转让账户、授权他人使用您的账户以及与他人交易账户。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5、鉴于网络服务的特殊性，遵义1935无义务审核是否是您本人使用该组用户名及密码，仅审核用户名及密码是否与数据库中保存的一致，任何人只要输入的用户名及密码与数据库中保存的一致，即可凭借该组用户名及密码登录并获得遵义1935所提供的各类服务，所以即使您认为您的账户登录行为并非您本人所为，遵义1935将不承担因此而产生的任何责任。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6、您可以通过在遵义1935参与预约商品、线上活动、交易市场、每日签到、参与直播、交易等方式获得积分、抵用券（具体名称相见本APP）。积分和抵用券都具有特定的使用规则和有效期，逾期将被清零；请您不时关注您账户中的积分和抵用券的有效期，在有效期届满前，遵义1935将不再另行作特别通知；遵义1935不对逾期清零的积分和抵用券负责。对于恶意购买和不正当手段获得的积分和抵用券，遵义1935有权作出独立判断并采取包含但不限于冻结您的用户账户或清空积分、抵用券等措施。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 7、用户向遵义1935提出注销账户申请，经商城审核同意后，由商城注销该用户账户，本协议即告终止。但在注销该用户账户后，本商城仍有权：① 保留该用户的注册信息及过往的全部交易行为记录② 如用户在账户注销前在商城上存在违法行为或违反本协议的行为，本商城仍可行使本协议所规定的权利。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 三、在下列情况下，遵义1935可以通过注销用户账户的方式单方解除本协议：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1）、① 在用户违反本协议相关规定时，遵义1935有权暂停或终止向该用户提供服务。如该用户在遵义1935暂停或终止提供服务后，再一次直接或间接或以他人名义注册为遵义1935用户的，则遵义1935有权再次暂停或终止向该用户提供服务；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ② 一经发现用户注册信息中的内容是虚假的，遵义1935即有权终止向该用户提供服务；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ③ 本协议修改或更新时，如用户表示不愿接受新的服务协议的，遵义1935有权终止向该用户提供服务；</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ④ 遵义1935认为需终止提供服务的其他情况。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、用户理解并同意，即便在本协议终止及用户的服务被终止后，遵义1935仍有权：① 继续保存并使用您的用户信息；② 继续向用户主张在其使用遵义1935交易平台服务期间因违反法律法规、本协议及平台规则而应承担的责任。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 四、订单规则</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、遵义1935仅向交易双方提供技术平台以便交易双方之间达成相关的交易，遵义1935并非交易的参与方，不对卖家的任何口头、书面陈述或者向遵义1935平台的线上信息及商品之真实性、合法性做任何明示或暗示的担保，或对此承担任何责任。如因拍品交易产生纠纷的，均由卖家以自己的名义独立承担所有相应的法律责任。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 2、当您下订单时，请您仔细确认所预约、所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与您本人不一致的，收货人的行为视为您的行为，您对收货人的行为承担连带责任。您提交订单即表示对订单中所确认的交易商品、收货地址等信息的准确性负责。如果因为您填写的收货人联系电话、地址等信息错误，导致物流将货物交付给非您本意的收货人的，由此造成的损失需由您自行承担。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 五、您理解并认可遵义1935软件上的订单成立规则：</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ① 遵义1935软件上展示的商品信息（如商品名称、价格、商品描述等）仅构成要约邀请。当用户通过遵义1935软件交易商品，确定交易并成功提交订单时（订单内容应包含交易的商品数量、价格及支付方式、收货人、联系方式、收货地址等信息），即视为用户向遵义1935/商家发出了交易订单商品的要约。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ② 当遵义1935/商家通过遵义1935软件向用户发出短信/系统推送通知确认商品已发出，或遵义1935/商家已将商品发送至用户指定地址时，才构成遵义1935/商家对该订单的承诺，此时订购合同即告成立。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; ③ 如果用户在一张订单中交易了多件商品，并向遵义1935/商家只向用户发出了关于其中一部分商品确认发货的短信/系统推送通知，那么直到遵义1935/商家发出关于其他部分商品确认发货的短信/系统推送通知，或遵义1935/商家将其他部分商品发送至用户指定地址时，关于其他部分商品的交易合同方告成立。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 4、若您拟交易的商品超过遵义1935软件公示的交易数量限制，请您与遵义1935客服联系。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 5）、 您有权在下列情况下，取消订单：① 经与遵义1935/商家协商达成一致的；② 遵义1935/商家对用户订单做出承诺之前；③ 遵义1935软件上公布的商品价格发生变化或错误，用户在遵义1935/商家发货之前通知遵义1935/商家的。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 6、遵义1935在下列情况下，亦可取消用户订单：① 因不可抗力、遵义1935软件系统发生故障或遭受第三方攻击，及其他遵义1935软件无法控制的情形，根据遵义1935软件判断需要取消用户订单的；② 经遵义1935软件判断，用户交易行为不符合公平原则或诚实信用原则的情形；③ 按遵义1935软件已经发布的或将来可能发布或更新的各类规则，可取消用户订单的其他情形。</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 六、用户权利与义务</p><p><br/></p><p><br/></p><p><br/></p><p>&nbsp; 1、 您有权根据本协议的约定，以及遵义1935软件上发布的相关规则在遵义1935软件（含遵义1935移动客户端及其他登录客户端）上查询和